import Item from "./item";
import {useState} from 'react';

function List(){
const [num,setNum]=useState([1,2]);
const [show,setShow]=useState(false);
return (<>
<button onClick={()=>{
    setShow(!show)
}}>show</button>
<input type ='text'>
    <label></label>
</input>
<button onClick={()=>{
    setNum([...num,Math.random()])
}}>addNum</button>
{
    
    show && num.map((i)=>{
        return <Item i={i}></Item>
    })
}
</>

)
}
export default List;
